import ExpenceItem from './components/ExpenseItem';

// Components are just JS functions

//Used as a custom HTML
function App() {
	const expenses = [
		{
			date: new Date(2022, 3, 25),
			title: 'Tesla Model X 2022',
			amount: 450.0,
		},
		{
			date: new Date(2023, 4, 5),
			title: 'Range Rover Vogue 2022',
			amount: 650.0,
		},
		{
			date: new Date(2022, 2, 22),
			title: 'Mercedes-Benz S Coupe 2018',
			amount: 250.0,
		},
		{
			date: new Date(2025, 7, 12),
			title: 'Mercedes-Benz G65 2023',
			amount: 850.0,
		},
	];

	return (
		<div>
			<h2>Мои машины:</h2>

			<ExpenceItem
				date={expenses.at(0).date}
				title={expenses.at(0).title}
				amount={expenses.at(0).amount}
			/>
			<ExpenceItem
				date={expenses.at(1).date}
				title={expenses.at(1).title}
				amount={expenses.at(1).amount}
			/>
			<ExpenceItem
				date={expenses.at(2).date}
				title={expenses.at(2).title}
				amount={expenses.at(2).amount}
			/>
			<ExpenceItem
				date={expenses.at(3).date}
				title={expenses.at(3).title}
				amount={expenses.at(3).amount}
			/>
		</div>
	);
}

export default App;
